import { createSlice } from "@reduxjs/toolkit";
const selectProdactSlice = createSlice({
    name: "selectProduct",
    initialState: {},
    reducers: {
        setSelectorProdact: () => {
            console.log("aa")
        }
    }
})
export const { setSelectorProdact } = setSelectorProdact.actions;
export default selectProdactSlice.reducers;
